import React from "react";
import { Button, Box, TextField, Container, TableRow } from "@mui/material";
import './index.css';

function Login() {
  return (
    <div class="container">
      <div style={{ align: "center" }}>
        <Box sx={{ width: "100%", maxWidth: 360, bgcolor: "yellow" }}>
          <TextField
            fullWidth
            id="outlined-basic"
            label="Username"
            variant="outlined"
          />
          <TextField
            fullWidth
            id="outlined-password-input"
            label="Password"
            type="password"
          />
          <Button fullWidth variant="contained" sx={{}}>
            Login
          </Button>
        </Box>
      </div>
    </div>
  );
}

export default Login;
